import React from 'react';
import './TopBar.scss';

function TopBar() {
  return (
    <div id="navigation-bar">
      <nav>
        <ul>
          <li><a href="#">About</a></li>
          <li><a href="#">Portfolio</a></li>
          <li><a href="#">Services</a></li>
          <li><a href="#">Contact</a></li>
          <a href="#" id="menu-icon"></a>
        </ul>
      </nav>
    </div>
  );
}

export default TopBar;
